import React from 'react'
import { useState} from 'react'
import { weatherData } from '../js/watherScript'

export const MaxMin = () => {
    const [max, setMax] = useState(weatherData.main.temp_max.toFixed(0));
    const [min, setMin] = useState(weatherData.main.temp_min.toFixed(0));

  return (
    <div className='row'>
        <div className='col-12 maxMin'>
        <p className='max'>Max.: {max}º</p>
        <p className='min'>Min.: {min}º</p>
        </div>


    </div>
  )
}
